val inputds = sc.textFile("hdfs://scispark1.jpl.nasa.gov:8090/tmp/StormEvents_details-ftp_v1.0_d2006_c20160223.csv")
val ds = inputds.map{ line =>
    val reader = new CSVReader(new StringReader(line));
    reader.readNext();
}
ds.first()
val resultds = ds.mapPartitionsWithIndex{(idx, iter) => if (idx == 0) iter.drop(1) else iter}

def dollarsConversion (y:String): Double = {
    var dollars:Double = 0.0
    try{
        if (!y.isEmpty && (y.trim.takeRight(1) == "K" || y.trim.takeRight(1) == "k")){
            dollars = y.trim.dropRight(1).toDouble*1000.0
        }else if (!y.isEmpty && (y.trim.takeRight(1) == "M" || y.trim.takeRight(1) == "m")){
            dollars = y.trim.dropRight(1).toDouble*1000000.0
        }
    } catch {
        case _: Throwable => None
    }
    return dollars
}

def cleanSource (s:String): String = {
    var cleaned = ""
    if (s.toLowerCase() contains "high") {
        cleaned = "dept of highway"
    }else if ( s.toLowerCase() contains "nws obs"){
        cleaned = "official nws obs"
    }else if (s.toLowerCase() contains "fire"){
        cleaned = "fire/rescue"
    }else{
        cleaned = s
    }
    cleaned
}

def convertTime (t1:String, tz1:String): String = {
    val tzone = tz1 //.take(3)
    val t1format = new SimpleDateFormat("dd-MMM-yy HH:mm:ss zzzzzz")
    val tformat = new SimpleDateFormat("dd-MMM-yyyy HH:mm:ss")
    tformat.setTimeZone(TimeZone.getTimeZone("UTC"))
    // val tformat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss")
    if (t1.toString() == ""){
        return null
    } 
    else {
        val t2 = t1format.parse(t1 + " "+ tzone)
        val t = tformat.format(t2)
        return t
    }
}

def categories(curr:String): String = {
    val automated = List("awss", "asos","snotel","raws","awos", "mesonet", "c-man", "bouy", "cocorahs")
    val amateur = List("radio", "trained" , "pilot", "utility", "chaser","observer", "coop")
    val amOfficial = List("high", "fire/rescue", "coast gu" , "park","forest" , "emergency man", "other federal" , "ment official", "law", "govt")

    for (ia <- curr.split(",")){
        if (automated.contains(ia)){
           return "automated" 
        }else if (amateur.contains(ia)){
           return "amateur" 
        }else if (amOfficial.contains(ia)){
           return "amOfficial" 
        }
    }
     for (ia <- curr.split(" ")){
        if (automated.contains(ia)){
           return "automated" 
        }else if (amateur.contains(ia)){
           return "amateur" 
        }else if (amOfficial.contains(ia)){
           return "amOfficial" 
        }
    }
    curr
}


